function App() {
  const handleLoginSuccess = () => { console.log("Login Success!!!") }
  return (
    <div className="App">
      <header className="App-header">
        <LoginScreen onLoginSuccess={handleLoginSuccess} />
      </header>
    </div>
  );
}

export default App;
